import mysql from "mysql2";

//  
const pool = mysql.createPool(
  process.env.JAWSDB_URL ?? {
    host: 'localhost',
    user: 'root',
    database: 'week10',
    password: 'mo9040154@@',
    waitForConnections: true,
    connectionLimit: 10,
    queueLimit: 0
  }
);

// async / await (  )
const promisePool = pool.promise();

// select query
//user department bus  
export const selectSql = {
  getUsers : async () => {
    const [rows] = await promisePool.query(`select * from user`);//
    
    return rows
  },
  getDepartment : async () => {
    const [rows] = await promisePool.query(`select * from department`);

    return rows
  },
  getBus : async () => {
    const [rows] = await promisePool.query(`select * from bus`);

    return rows
  },
}


// delete query'
//    
//   
//    
export const deleteSql = {
 

  deleteDepartment : async (data) => {//  delete  .
    console.log('deleteSql.deleteDepartment:',data.Dnumber);
    const sql = `delete from department where Dnumber ="${data.Dnumber}"`;
    await promisePool.query(sql);//sql   parameter   

  },
  deleteBus : async (data) => {//bus     delete 
    console.log('deleteSql.deleteBus:',data.Bnumber);
    const sql = `delete from bus where Bnumber ="${data.Bnumber}"`;
    await promisePool.query(sql);

  },
}

